import React, { Component } from 'react'

export default class Score extends Component {
    render() {
        console.log(props)
        return (
            <div>
                <tr>
                    <td>{props.user_id}</td>
                    <td>{props.points}</td>
                    <td>{props.level}</td>
                    <td>{props.rows}</td>
                </tr>
            </div>
        )
    }
}
